style.css:
/* Change la couleur de fond de toutes les pages */
body {
  background-color: #f0f0f0;
}

/* Change la couleur et la police des titres */
h1, h2, h3 {
  color: #333;
  font-family: 'Arial', sans-serif;
}

/* Redimensionne et change le style des boutons */
button {
  background-color: #007BFF;
  color: white;
  border: none;
  padding: 10px;
  font-size: 16px;
  border-radius: 5px;
}
@-moz-document domain("roblox.com") {
body {
    background-color: #f0f0f0;
  }
}
